import React from 'react';
import { Link } from 'react-router-dom';

const Sidebar = () => {
  return (
    <div className="w-1/6 min-h-screen bg-gray-800 text-white flex flex-col justify-between">
      <nav className="flex flex-col">
        <h1 className="text-2xl font-bold px-4 pt-8 pb-5 pl-6">Notion Clone</h1>
        <Link to="/Home" className="p-7 pt-6 hover:bg-gray-700">Home</Link>
        <Link to="/tasktracker" className="p-7 pt-6 hover:bg-gray-700">Task Tracker</Link>
        <Link to="/page3" className="p-7 pt-6 hover:bg-gray-700">TBD</Link>
      </nav>
      <div className="p-7 hover:bg-red-600 bg-red-500 text-center">
        <Link to="/" className="block">Logout</Link>
      </div>
    </div>
  );
};

export default Sidebar;
